import React from 'react';
import waterBusImage2 from '/home/jim/my personals as a beginer/luanda react/luanda-kotieno/src/components/images/water bus 2.jpg';
import waterBusImage3 from '/home/jim/my personals as a beginer/luanda react/luanda-kotieno/src/components/images/water bus 3.jpg';

function WaterBus() {
  return (
    <div>
      <h1>WaterBus</h1>
      <div>
        <img src={waterBusImage2} alt="Water Bus" title="Water Bus" />
        <img src={waterBusImage3} alt="The bus" title="The yellow vessel" />
      </div>
      <p>
        Similar to the ferry, the water bus moves from Luanda to Mbita and back. The difference is that it carries only passengers and a few motorcycles.</p>
        <p>It costs 150ksh per person.</p>
        <p>It takes a duration of 30 minutes to dock at Mbita.
      </p>
    </div>
  );
}

export default WaterBus;
